const Button = styled.button`
    font-size: 1.5em;
    text-align: center;
    background-color: ${props => props.color ? props.color : "white"};
`

function ButtonComponent(props) {
    <Button
        color={props.color}
        onClick={handleClick}
    >
        {props.text}
    </Button>
}

export default ButtonComponent;
